import React, { useState } from "react";

const SignIn = () => {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [rememberMe, setRememberMe] = useState(false);

  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle login logic here
    console.log(
      "Email:",
      email,
      "Password:",
      password,
      "Remember Me:",
      rememberMe
    );
  };

  return (
    <Container>
      <LoginContainer>
        <Title>Sign in to explore</Title>
        <SocialButtons>
          <SocialButton>
            <img src="google_logo.png" alt="Continue with Google" /> Continue
            with Google
          </SocialButton>
          <SocialButton>
            <img src="facebook_logo.png" alt="Continue with Facebook" />{" "}
            Continue with Facebook
          </SocialButton>
          <SocialButton>
            <img src="apple_logo.png" alt="Continue with Apple" /> Continue with
            Apple
          </SocialButton>
        </SocialButtons>
        <OrDivider>
          <span>Or</span>
        </OrDivider>
        <Form onSubmit={handleSubmit}>
          <Input
            type="email"
            placeholder="Email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
          />
          <Input
            type="password"
            placeholder="Password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
          />
          <RememberMe>
            <input
              type="checkbox"
              id="remember-me"
              checked={rememberMe}
              onChange={(e) => setRememberMe(e.target.checked)}
            />
            <label htmlFor="remember-me">Remember Me</label>
          </RememberMe>
          <Button type="submit">Sign In</Button>
        </Form>
        <p>
          Don't have an account? <a href="#">Sign up now</a>
        </p>
      </LoginContainer>
    </Container>
  );
};

export default SignIn;
